      SUBROUTINE IrRegular10(PQx,PQy,PQz,Cpq,Spq)
         IMPLICIT NONE
         REAL*8 Cpq(0:65),Spq(0:65),LegendreP(0:65)
         REAL*8 Sine(0:10),Cosine(0:10),CoFact(2:10)
